Teesra Kaun|1965|Vintage Hindi Suspense Thriller|Xvid|MP3|Phantom

Prakash lives a fairly wealthy lifestyle with his widowed mother, and a sister, Renuka, who is soon to wed Dindayal, the only son of widower businessman Mukatlal. Before the wedding could be formalized, Prakash unexpectedly leaves, and the Police notify Mukatlal that his house has been broken into and diamonds worth Rs.8 Lakhs have been stolen. Mukatlal's servant informs them that he is able to identify Prakash as one of five of the culprits, the police launch a search for him, and the wedding gets canceled. Prakash returns home and informs his family and girlfriend, Shoba, that he has been framed, and sets out to try and convince Mukatlal also. Shortly thereafter, his mother will get the news that Mukatlal has been killed and the prime suspect is none other than her son.

This movie has melodious R D Burman numbers :
1.Achha Sanam Kar Le Sitam :- Asha Bhosle
2.O Dilruba O Tu Muskura :- Asha Bhosle
3.Pyaar Ke Fasana Banale Dil Diwana :- Lata Mangeshkar &amp; Mukesh
4.Meri Jaan Tu Khafa Hai Toh Kya Hua :- Mohd. Rafi
